import React from "react";
import Button2 from "../../../common/atoms/Button2";
import Header2 from "../../../common/blocks/Header2";
import Header1 from "../../../common/blocks/Header1";
import { IoIosArrowBack } from "react-icons/io";
import { useNavigation } from "../../../hooks/useNavigation";

const Followers = () => {
  const { navigateToMemberProfile } = useNavigation();
  const { navigateToFollowings } = useNavigation();

  const buttonsHeader = [
    {
      component: Button2,
      className: "font-TAEBAEKmilkyway",
      value: "뒤로가기",
      onClick: navigateToMemberProfile,
      icon: <IoIosArrowBack />,
    },
  ];

  const buttonsHeader2 = [
    {
      component: Button2,
      className: "font-TAEBAEKmilkyway",
      value: "팔로잉",
      onClick: navigateToFollowings,
    },
    {
      component: Button2,
      className: "font-TAEBAEKmilkyway",
      value: "팔로워",
    },
  ];

  // 유저 정보 배열 (예시로 10개의 유저 정보를 생성합니다)
  const users = [
    {
      id: 1,
      name: "유저1",
      birthDate: "January 1, 1990",
      constellation: "Orion",
      profileImageUrl: "https://picsum.photos/200",
    },
    {
      id: 2,
      name: "유저2",
      birthDate: "January 1, 1999",
      constellation: "Orion",
      profileImageUrl: "https://picsum.photos/190",
    },
    {
      id: 3,
      name: "유저3",
      birthDate: "January 30, 1996",
      constellation: "Orion",
      profileImageUrl: "https://picsum.photos/21",
    },
    // 여러 개의 유저 정보를 추가로 생성
    // { id: 2, name: ..., birthDate: ..., constellation: ..., profileImageUrl: ... }
    // { id: 3, name: ..., birthDate: ..., constellation: ..., profileImageUrl: ... }
    // ...
  ];

  return (
    <div>
      <Header2 buttons={buttonsHeader} />
      <Header1 buttons={buttonsHeader2} />
      <h1> 팔로워 리스트입니다..</h1>
      {users.map((user) => (
        <div key={user.id} className="flex items-start space-x-4">
          <img
            src={user.profileImageUrl}
            className="h-32 w-32 rounded-full"
            alt="Round image"
          />
          <div>
            <p className="text-lg font-bold">{user.name}</p>
            <p>탄생일: {user.birthDate}</p>
            <p>띄운 별: {user.constellation}</p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Followers;
